import React from "react";
import { useNavigate } from "react-router-dom";

function AllpostPage({ posts, logedinUser, setSelectedPost }) {
  const nav = useNavigate();

  function openPost(id, item) {
    nav("/singlepost/" + id);
    console.log("test");
    setSelectedPost(item);
  }

  return (
    <div className="posts">
      {posts.map((x, i) => (
        <div onClick={() => openPost(x.id, x)} key={i} className="singlepost">
          <img src={x.image} alt="" />
          <div>{x.title}</div>
          <div>{x.location}</div>
          <div>{logedinUser.email}</div>
        </div>
      ))}
    </div>
  );
}

export default AllpostPage;
